import React from "react";
import { Container, Row, Col, ListGroup, ListGroupItem } from "react-bootstrap";

const Details = (details) => {
  return (
    <div>
      {details.length === 0 ? (
        " "
      ) : (
        <Container>
          <h1>Welcome to {details.name}</h1>
          <Col>
            <img
              src={details.flag}
              height="auto"
              width="320px"
              alt="country flag"
            />
          </Col>
        </Container>
      )}
    </div>
  );
};

export default Details;
